import React from 'react';


function Welcome(props) {
  return (
    <h3>
      I like {props.name}.
    </h3>
  );
}

const peopleILike = [
  {
    name: "Kim",
    age: 6
  },
  {
    name: "Lim",
    age: 7
  },
  {
    name: "Lee",
    age: 9
  }
];


function App() {
  return (
    <div className="App">
      {peopleILike.map((el) => <Welcome name={el.name}></Welcome>)}
    </div>
  );
}


export default App;
